import Admin from '../pages/Admin'
import User from '../pages/User'
import PageNotFound from '../pages/PageNotFount'

export const mainRouter=[{
    path:'/admin',
    component:Admin
},{
    path:'/user',
    component:User
},{
    path:'pageNotFound',
    component:PageNotFound
}]
